            nome: 'Usuário Admin',
            username: '123',
            password: '123',
            perfil: 'gerente',
            ativo: true,
            created_at: new Date().toISOString()
        }
    ];

    return (
        <View style={styles.container}>
            <View style={styles.header}>
                <Title style={styles.title}>Administração de Usuários</Title>
